import React, { Suspense } from "react";
import { Redirect, Route, Switch } from "react-router-dom";

const Home = ({ match }) => (
  <Suspense fallback={<div className="loading" />}>
    <Switch>
      <Redirect exact from={`${match.url}/`} to={`${match.url}`} />
      <Route path={`${match.url}`} />
      <Redirect to="/error" />
    </Switch>
  </Suspense>
);
export default Home;
